

SET NAMES utf8;
SET FOREIGN_KEY_CHECKS = 0;

-- ----------------------------
--  Table structure for `t_hospital`
-- ----------------------------
DROP TABLE IF EXISTS `t_hospital`;
CREATE TABLE `t_hospital` (
  `hospital_id` int(11) NOT NULL DEFAULT '0',
  `hospital_name` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '医院名称',
  `province` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '省',
  `city` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '市',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_user` varchar(20) COLLATE utf8_bin DEFAULT 'qybx' COMMENT '修改人',
  `hospital_level` varchar(10) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '医院等级',
  `is_open` tinyint(1) NOT NULL DEFAULT '0' COMMENT '医院是否开通：0-未开通，1-已开通',
  `self_scale_process` tinyint(4) NOT NULL DEFAULT '0' COMMENT '处理自负比例的方法标志位，0为使用已有的selfScale，1为使用处理方法',
  `thread_no` int(5) DEFAULT '3' COMMENT '医院访问最大线程数',
  `allowed_mode` tinyint(4) NOT NULL DEFAULT '0' COMMENT '住院号位数的匹配模式。0 无规律；1 固定位数',
  `allowed_pattern` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '住院号位数的匹配表达式。目前支持固定位数，如5或5，7',
  `address` varchar(1024) COLLATE utf8_bin DEFAULT NULL COMMENT '医院地址',
  `his_provider` varchar(1024) COLLATE utf8_bin DEFAULT NULL COMMENT 'his厂商',
  `check_result` text COLLATE utf8_bin COMMENT '验收结果',
  PRIMARY KEY (`hospital_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='医院信息表';

